import itertools

from week_2_find_origin.approximate_matching import approximate_pattern_match
from week_2_find_origin.hamming_tools import hamming_dist, hamming_ball


def reverse_complement(sequence):
    convertor = {'A':'T', 'T':'A', 'C':'G', 'G':'C'}
    rev_comp = ''
    for c in reversed(sequence):
        rev_comp += convertor[c]
    return rev_comp


def compute_neighbourhood(d, k, pattern):
    abreviations = set()
    alpha = ['A','C','G','T']
    for perm in list(itertools.permutations(alpha)):
        word = ''.join(perm)
        if hamming_dist(word, pattern) <= d:
            abreviations.add(word)

    return len(abreviations)


def find_possible_neighbours(gene, seq_len, max_dist):
    alph = ['A','C','G','T']
    neighbourhood = set()
    for i in range(len(gene) - seq_len + 1):
        tmp = gene[i:i + seq_len]
        neighbourhood.update(hamming_ball(tmp, max_dist, alph))
    return neighbourhood


def freq_word_with_mismatch(sequence, sub_seq_len, max_miss):
    """

    :param sequence:
    :param sub_seq_len:
    :param max_miss:
    :return:
    """
    candidates = find_possible_neighbours(sequence,sub_seq_len,max_miss)
    results = {}
    for candidate in candidates:
        results[candidate] = approximate_pattern_match(sequence, candidate, max_miss)
    max_val = max(results.values())
    for key in results.keys():
        if results[key] == max_val:
            print(key, str(results[key]))


def freq_word_with_mismatch_with_reverse(sequence, sub_seq_len, max_miss):
    """
    Frequent Words with Mismatches and Reverse Complements Problem
    :param sequence:
    :param sub_seq_len:
    :param max_miss:
    :return:
    """
    candidates = find_possible_neighbours(sequence, sub_seq_len, max_miss)
    results = {}
    for candidate in candidates:
        results[candidate] = approximate_pattern_match(sequence, candidate, max_miss) + \
                             approximate_pattern_match(sequence, reverse_complement(candidate), max_miss)
    max_val = max(results.values())
    for key in results.keys():
        if results[key] == max_val:
            print(key, str(results[key]))


